import { createAction, createAsyncThunk } from "@reduxjs/toolkit";
import axiosInstance from "axios";

// Axios instance with base URL and headers
const axios = axiosInstance.create({
  baseURL: "http://localhost:8080", // You may adjust this as per your backend
  headers: {
    "Content-Type": "application/json",
  },
});

class Api {
  // Reset all state (action)
  resetAll = createAction("resetAll");

  // User APIs
  getUsers = createAsyncThunk("users/getAll", async (_, { rejectWithValue }) => {
    try {
      const response = await axios.get("/api/users/admin");
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  register = createAsyncThunk("users/register", async (data, { rejectWithValue }) => {
    try {
      const response = await axios.post("/api/users/register", { ...data });
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data });
    }
  });

  login = createAsyncThunk("users/login", async (data, { rejectWithValue }) => {
    try {
      const response = await axios.post("/login", { ...data });
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data });
    }
  });

  deleteUser = createAsyncThunk("users/delete", async (id, { rejectWithValue }) => {
    try {
      const response = await axios.delete(`/admin/users/${id}`);
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  // Course APIs
  getCourses = createAsyncThunk("courses/getAll", async (_, { rejectWithValue }) => {
    try {
      const response = await axios.get("/courses");
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  createCourse = createAsyncThunk("courses/create", async (data, { rejectWithValue }) => {
    try {
      const response = await axios.post("/courses/register", { ...data });
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  getCourse = createAsyncThunk("courses/get", async (id, { rejectWithValue }) => {
    try {
      const response = await axios.get(`/courses/${id}`);
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  deleteCourse = createAsyncThunk("courses/delete", async (id, { rejectWithValue }) => {
    try {
      const response = await axios.delete(`/courses/${id}`);
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  searchCourse = createAsyncThunk("courses/search", async (title, { rejectWithValue }) => {
    try {
      const response = await axios.get(`/courses/searchByTitle/${title}`);
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  updateCourse = createAsyncThunk("courses/update", async (data, { rejectWithValue }) => {
    try {
      const response = await axios.patch(`/courses/${data.id}`, { ...data });
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  // Enrollment APIs
  getEnrollments = createAsyncThunk("enrollments/getAll", async (_, { rejectWithValue }) => {
    try {
      const response = await axios.get("/enrollment");
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  createEnrollment = createAsyncThunk("enrollments/create", async (data, { rejectWithValue }) => {
    try {
      const response = await axios.post("/enrollment", { ...data });
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data });
    }
  });

  getEnrollment = createAsyncThunk("enrollments/get", async (id, { rejectWithValue }) => {
    try {
      const response = await axios.get(`/enrollment/${id}`);
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  getEnrollmentByUser = createAsyncThunk("enrollments/getByUser", async (id, { rejectWithValue }) => {
    try {
      const response = await axios.get(`/enrollment/user/${id}`);
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  getEnrollmentByCourse = createAsyncThunk("enrollments/getByCourse", async (id, { rejectWithValue }) => {
    try {
      const response = await axios.get(`/enrollment/course/${id}`);
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });

  leave = createAsyncThunk("enrollments/leave", async (id, { rejectWithValue }) => {
    try {
      const response = await axios.delete(`/enrollment/leave/${id}`);
      return response.data;
    } catch (error) {
      console.error(error);
      return rejectWithValue({ error: error?.response?.data?.message });
    }
  });
}

export const apis = new Api();
